import React from 'react';

let Users = (props) => {
    return (
        <div>
            {
                props.users.map( (user)=> {
                    return  (
                        <div key={user.id}>
                        <span>
                            <div>
                                <img/>
                                <button></button>
                            </div>
                        </span>
                        <span>
                            <span>
                                <div>{user.fullName}</div><div>{}</div>
                            </span>
                            <span>
                                <div></div><div></div>
                            </span>

                        </span>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Users;
